import React from 'react';
import './Logo.css';

const Logo = ({ size = 'medium' }) => {
  return (
    <div className={`logo-container ${size}`}>
      <div className="logo-icon">
        <div className="logo-circle">
          <div className="logo-figures">
            <div className="figure figure-left"></div>
            <div className="figure figure-center"></div>
            <div className="figure figure-right"></div>
          </div>
        </div>
      </div>
      <div className="logo-text">
        <span className="logo-line-1">Social</span>
        <span className="logo-line-2">Care365</span>
      </div>
    </div>
  );
};

export default Logo;
